//===================================================
//初期化
//===================================================
void InitializeGameControl(void)
{
	g_stage = DEFAULT_STAGE_SETTING;
	g_instructions = false;
	g_NextTrigger = false;
	g_fanfareTrigger = false;
	g_fanfareCnt = 0;
	g_fanfareSeTrigger = true;
	instructionsCnt = 0;
	g_fanfareSe = opensound("Data\\fanfare.mp3");
	g_BGM = opensound("Data\\BGM.mp3");
	playsound(g_BGM, 1);
}

//===================================================
//更新
//===================================================
void UpdateGameControl(void)
{
	PLAYER player = GetPlayer();
	bool blacKOutTrigger = GetBlacKOutTrigger();

	updatesound(g_BGM);

	//プレイヤーのstageNumを基準にステージを変更する
	if (player.stageNum != g_stage)
	{
		if (g_fanfareCnt == 0 && g_stage != DEFAULT_STAGE_SETTING)
		{
			g_fanfareTrigger = true;
		}

		if (g_fanfareTrigger)
		{
			//ファンファーレの音を再生
			if (g_fanfareSeTrigger == true)
			{
				playsound(g_fanfareSe, 0);
				g_fanfareSeTrigger = false;
			}
			//ファンファーレ実行
			g_fanfareCnt++;
			SetFanfareFever();
			if (g_fanfareCnt >= 60 * 3)
			{
				g_fanfareTrigger = false;
			}
		}
		else
		{
			SetFadeOut();

			if (blacKOutTrigger)//完全に暗くなったら実行
			{
				if (g_stage == FINAL_STAGE)
				{
					SetScene(SCENE_RESULT);
				}

				g_fadeCnt++;
				if (g_fadeCnt >= 60 * 1)
				{
					InitializeParts();
					InitializeFanfare();
					InitializeBullet();
					InitializeBlock();

					switch (player.stageNum)
					{
					case STAGE1:
						SetStage(stage1);

						g_stage = STAGE1;
						break;

					case STAGE2:
						SetStage(stage2);
						SetBlock(152, 10, BLOCK_SIMPLE, true, 15, 2, 0.1f, 176, 10);

						g_stage = STAGE2;
						break;

					case STAGE3:
						SetStage(stage3);
						SetBlock(60, 28, BLOCK_MAGNET_PLUS, true, 15, 2, 0.3f, 130, 28);

						g_stage = STAGE3;
						break;

					case STAGE4:
						SetStage(stage4);

						g_stage = STAGE4;
						break;

					case STAGE5:
						SetStage(stage5);
						SetBlock(46, 29, BLOCK_MAGNET_MINUS, true, 15, 2, 0.1f, 46, 10);
						SetBlock(66, 47, BLOCK_MAGNET_PLUS, true, 15, 2, 0.1f, 66, 30);
						SetBlock(126, 47, BLOCK_SIMPLE, true, 15, 2, 0.15f, 126, 30);
						SetBlock(146, 30, BLOCK_SIMPLE, true, 15, 2, 0.15f, 146, 47);

						g_stage = STAGE5;
						break;

					case STAGE6:
						SetStage(stage6);
						SetBlock(146, 18, BLOCK_SIMPLE, true, 15, 3, 0.10f, 116, 18);
						SetBlock(101, 26, BLOCK_SIMPLE, true, 15, 3, 0.10f, 131, 26);
						SetBlock(56, 18, BLOCK_SIMPLE, true, 10, 3, 0.15f, 76, 18);
						SetBlock(66, 26, BLOCK_SIMPLE, true, 10, 3, 0.10f, 31, 26);
						SetBlock(41, 18, BLOCK_SIMPLE, true, 10, 3, 0.15f, 16, 18);

						SetBlock(146, 30, BLOCK_TURRET_TOP, true, 1, 1, 0.10f, 116, 30);
						SetBlock(66, 16, BLOCK_TURRET_UNDER, true, 1, 1, 0.10f, 31, 16);

						g_stage = STAGE6;
						break;

					case STAGE7:
						SetStage(stage7);
						SetBlock(31, 31, BLOCK_MAGNET_PLUS, true, 15, 2, 0.4f, 31, 16, 171, 16, 171, 31);
						SetBlock(31, 16, BLOCK_SIMPLE, true, 15, 2, 0.2f, 171, 16, 171, 31, 31, 31);
						SetBlock(171, 16, BLOCK_MAGNET_PLUS, true, 15, 2, 0.4f, 171, 31, 31, 31, 31, 16);
						SetBlock(171, 31, BLOCK_SIMPLE, true, 15, 2, 0.2f, 31, 31, 31, 16, 171, 16);

						g_stage = STAGE7;
						break;

					case STAGE8:
						SetStage(stage8);

						g_stage = STAGE8;
						break;

					case STAGE9:
						SetStage(stage9);
						SetBlock(36, 24, BLOCK_SIMPLE, true, 15, 2, 0.15f, 36, 13);
						
						SetBlock(81, 30, BLOCK_SIMPLE, true, 10, 2, 0.15f, 81, 13);
						SetBlock(96, 15, BLOCK_SIMPLE, true, 15, 2, 0.15f, 96, 5);
						SetBlock(96, 37, BLOCK_SIMPLE, true, 15, 2, 0.15f, 96, 46);
						
						SetBlock(136, 1, BLOCK_SIMPLE, true, 10, 2, 0.15f, 136, 47);
						SetBlock(151, 47, BLOCK_SIMPLE, true, 10, 2, 0.15f, 151, 1);
						SetBlock(166, 1, BLOCK_SIMPLE, true, 9, 2, 0.15f, 166, 47);

						g_stage = STAGE9;
						break;

					case STAGE10:
						SetStage(stage10);
						SetBlock(36, 24, BLOCK_MAGNET_PLUS, true, 15, 2, 0.15f, 36, 13);
						
						SetBlock(81, 30, BLOCK_MAGNET_PLUS, true, 10, 2, 0.15f, 81, 13);
						SetBlock(96, 15, BLOCK_MAGNET_MINUS, true, 15, 2, 0.15f, 96, 5);
						SetBlock(96, 37, BLOCK_MAGNET_PLUS, true, 15, 2, 0.15f, 96, 46);
						
						SetBlock(136, 1, BLOCK_MAGNET_MINUS, true, 10, 2, 0.15f, 136, 47);
						SetBlock(151, 47, BLOCK_MAGNET_PLUS, true, 10, 2, 0.15f, 151, 1);
						SetBlock(166, 1, BLOCK_MAGNET_MINUS, true, 9, 2, 0.15f, 166, 47);

						g_stage = STAGE10;
						break;

					case STAGE11:
						SetStage(stage11);
						SetBlock(146, 18, BLOCK_SIMPLE, true, 15, 3, 0.10f, 116, 18);
						SetBlock(101, 26, BLOCK_SIMPLE, true, 15, 3, 0.10f, 131, 26);
						SetBlock(56, 18, BLOCK_SIMPLE, true, 10, 3, 0.15f, 76, 18);
						SetBlock(66, 26, BLOCK_SIMPLE, true, 10, 3, 0.10f, 31, 26);
						SetBlock(41, 18, BLOCK_SIMPLE, true, 10, 3, 0.15f, 16, 18);

						SetBlock(146, 30, BLOCK_TURRET_TOP, true, 1, 1, 0.10f, 116, 30);
						SetBlock(101, 16, BLOCK_TURRET_UNDER, true, 1, 1, 0.10f, 131, 16);
						SetBlock(56, 30, BLOCK_TURRET_TOP, true, 1, 1, 0.15f, 76, 30);
						SetBlock(66, 16, BLOCK_TURRET_UNDER, true, 1, 1, 0.10f, 31, 16);
						SetBlock(41, 30, BLOCK_TURRET_TOP, true, 1, 1, 0.15f, 16, 30);
						g_stage = STAGE11;
						break;

					case STAGE12:
						SetStage(stage12);
						SetBlock(105, 2, BLOCK_TURRET_UNDER, true, 1, 1, 0.05f, 86, 2);
						g_stage = STAGE12;
						break;

					case STAGE13:
						SetStage(stage13);
						
						g_stage = STAGE13;
						break;

					case STAGE14:
						SetStage(stage14);
						SetBlock(175, 34, BLOCK_TURRET_TOP, true, 1, 1, 1.0f, 155, 34);
						SetBlock(136, 33, BLOCK_TURRET_TOP, true, 1, 1, 1.0f, 151, 33);
						g_stage = STAGE14;
						break;

					case STAGE15:
						SetStage(stage15);

						g_stage = STAGE15;
						break;

					default:
						break;
					}
					
					SetPlayer();
					g_fanfareSeTrigger = true;
					g_fanfareCnt = 0;
					g_fadeCnt = 0;
					SetFadeIn();
				}
			}
		}
	}

	if (g_stage == STAGE1 && player.remain < REMAIN)
	{
		instructionsCnt++;
		if (instructionsCnt > 60 * 6)
		{
			g_instructions = true;
			instructionsCnt = 0;
		}
	}
	else
	{
		g_instructions = false;
	}
}

