//===================================================
//説明文表示を取得
//===================================================
void SetStage(char stage[DRAWING_HEIGHT_MAX][DRAWING_WIDTHW_MAX])
{
	for (int i = 0; i < DRAWING_HEIGHT_MAX; i++)
	{
		for (int j = 0; j < DRAWING_WIDTHW_MAX; j++)
		{
			//上面
			if ((stage[abs(i - 1)][j] == AIR || stage[abs(i - 1)][j] == BLOCK_GOAL || stage[abs(i - 1)][j] == BLOCK_START || stage[abs(i - 1)][j] == BLOCK_TURRET_TOP) && i != 0)
			{
				switch (stage[i][j])
				{
				case BLOCK_SIMPLE:
					SetBlock(j, i, BLOCK_SIMPLE, true);
					break;
				case BLOCK_MAGNET_PLUS:
					SetBlock(j, i, BLOCK_MAGNET_PLUS, true);
					break;
				case BLOCK_MAGNET_MINUS:
					SetBlock(j, i, BLOCK_MAGNET_MINUS, true);
					break;
				case BLOCK_TURRET_LEFT:
					SetBlock(j, i, BLOCK_TURRET_LEFT, true);
					break;
				case BLOCK_TURRET_RIGHT:
					SetBlock(j, i, BLOCK_TURRET_RIGHT, true);
					break;
				case BLOCK_TURRET_TOP:
					SetBlock(j, i, BLOCK_TURRET_TOP, true);
					break;
				case BLOCK_TURRET_UNDER:
					SetBlock(j, i, BLOCK_TURRET_UNDER, true);
					break;
				case BLOCK_START:
					SetBlock(j, i, BLOCK_START, true);
					break;
				case BLOCK_GOAL:
					SetBlock(j, i, BLOCK_GOAL, true);
					break;
				default:
					break;
				}
			}
			//側面
			else
			{
				switch (stage[i][j])
				{
				case BLOCK_SIMPLE:
					SetBlock(j, i, BLOCK_SIMPLE, false);
					break;
				case BLOCK_MAGNET_PLUS:
					SetBlock(j, i, BLOCK_MAGNET_PLUS, false);
					break;
				case BLOCK_MAGNET_MINUS:
					SetBlock(j, i, BLOCK_MAGNET_MINUS, false);
					break;
				case BLOCK_TURRET_LEFT:
					SetBlock(j, i, BLOCK_TURRET_LEFT, false);
					break;
				case BLOCK_TURRET_RIGHT:
					SetBlock(j, i, BLOCK_TURRET_RIGHT, false);
					break;
				case BLOCK_TURRET_TOP:
					SetBlock(j, i, BLOCK_TURRET_TOP, false);
					break;
				case BLOCK_TURRET_UNDER:
					SetBlock(j, i, BLOCK_TURRET_UNDER, false);
					break;
				case BLOCK_START:
					SetBlock(j, i, BLOCK_START, false);
					break;
				case BLOCK_GOAL:
					SetBlock(j, i, BLOCK_GOAL, false);
					break;
				default:
					break;
				}
			}
		}
	}
}

